description:
पछिल्लो समय नेपाली बजारमा केराको अभाव देखिनुका साथै मूल्य पनि आकासिएको छ ।&amp;nbsp;

सबैभन्दा कम केरा खपत हुने हिउँदको सिजनमा पनि केराको अभाव हुँदै मूल्य २०० देखि २५० रूपैयाँसम्म दर्जन पुगेको छ ।

फलफूलको सबैभन्दा ठूलो खपत हुने काठमाडौं उपत्यकाभित्र

बिहीबार बिहान तराईका अधिकांश स्थानहरूमा हुस्सु/कुहिरो लागेको छ ।

जल तथा मौसम विज्ञान विभागको मौसम पूर्वानुमान महाशाखाका अनुसार हाल देशभर पश्चिमी वायुको आंशिक प्रभाव रहेको छ ।&amp;nbsp;

बिहीबार दिउँसो देशका तराई भू-भागमा हुस्सु तथा कुहिरो रहनेछ । को

निर्वाचन आयोगले निर्वाचन आचारसंहिता&amp;ndash;२०८२ को मस्यौदा सल्लाह सुझावका लागि जारी गरेको छ ।&amp;nbsp;

आगामी फागुन २१ गते हुने प्रतिनिधिसभा सदस्य निर्वाचनका लागि आयोगले आचारसंहिताको मस्यौदा जारी गरेको हो ।&amp;nbsp;

निर्वाचनमा स्वतन्त्रता, स्वच
